messages.message:
Based on our debugging locally, we figured out the table viewer is failing when the return value is with [[],[]] or [[]].

@Veera has fixed the issue and it has been merged and backported to the older releases. To unblock immediately, @Prasad can handle this scenario using the clean function. If needed we can work with the team to implement the workaround.

Thanks @Prasad @Saikat for your help!
